/* eslint-disable @typescript-eslint/no-unused-vars */

import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { ToastContainer } from "react-toastify";
import Home from './components/home';
import SignUp from './components/signUp';
import BusinessSignUp from './components/businessSignUp';
import SignIn from './components/signIn';
import About from './components/about';
import { createContext, useState } from 'react';
import StartNavbar from './components/startNavbar';
import Stam from './components/stam';


const themes = {
  light:{
    color: "#161616",
    background: "white",
    btn: "orange"
  },
  dark:{
    color: "white",
    background: "#161616",
    btn: "purple"
  }
}

export const SiteTheme = createContext(themes.light);

function App() {
  const [darkMod,setDarkMod] = useState<boolean>(false);
  let [logged,setLogged] = useState<boolean>(false);
  return <>
  <Router>
    <ToastContainer />

    <SiteTheme.Provider value={darkMod ? themes.dark : themes.light}>
    {logged ? 
    (
      <>
            <Routes>
              <Route path='/' element={<Stam setLogged={setLogged} />} />
            </Routes>
      </>

    ) 
    : 
    (
      <>
      <StartNavbar darkMod={darkMod} setDarkMod={setDarkMod} />
      <Routes>
        <Route path='/about' element={<About />} />
        <Route path='/' element={<Home />} />
        <Route path='/signup' element={<SignUp />} />
        <Route path='/business-signup' element={<BusinessSignUp />} />
        <Route path='/signin' element={<SignIn setLogged={setLogged} />} />
      </Routes>
      </>

    )}

    </SiteTheme.Provider>

  </Router>
  </>

}

export default App;
